import React from "react";
// import { Link } from "react-router-dom";
import { NavLink, useNavigate,  } from "react-router-dom";

import "./index.css";

const Navbar = () =>{
    const history = useNavigate();
    return(
        <>
           <header>
            <nav>
            <ul>
                <li>
                <NavLink className="active_class" to='/'>About Us</NavLink>
                </li>
                <li>
                <NavLink className="active_class" to='/contact'>Contact Us</NavLink>
                </li>
                <li>
                <NavLink  className="active_class" to='/contact/name'>Name</NavLink>
                </li>
                <li>
                <NavLink  className="active_class" to='/user/Asad Rehman'>User</NavLink>
                </li>
                <li>
                    <button onClick={()=>history(-1)}>Go Back</button>
            
                    <button onClick={()=>history(`/`)}> Go to Home</button>
                </li>
            </ul>
                
            </nav>
           </header>

        </>
    )
}
export default Navbar;
